    END DO
    END DO
  END IF
  Int_BufSz   = Int_BufSz   + 1     ! xd_BD allocated yes/no
  IF ( ALLOCATED(InData%xd_BD) ) THEN
    Int_BufSz   = Int_BufSz   + 2*2  ! xd_BD upper/lower bounds for each dimension
    DO i2 = LBOUND(InData%xd_BD,2), UBOUND(InData%xd_BD,2)
