  DEALLOCATE(MiscLinTypeData%LinTimes)
ENDIF
IF (ALLOCATED(MiscLinTypeData%AzimTarget)) THEN
  DEALLOCATE(MiscLinTypeData%AzimTarget)
ENDIF
