         DEALLOCATE(Int_Buf)
      END IF
    END DO
  END IF
  Int_BufSz   = Int_BufSz   + 1     ! Input allocated yes/no
  IF ( ALLOCATED(InData%Input) ) THEN
    Int_BufSz   = Int_BufSz   + 2*2  ! Input upper/lower bounds for each dimension
    DO i2 = LBOUND(InData%Input,2), UBOUND(InData%Input,2)
