      ENDIF
  IF ( .NOT. ALLOCATED(InData%Output) ) THEN
    IntKiBuf( Int_Xferred ) = 0
    Int_Xferred = Int_Xferred + 1
  ELSE
    IntKiBuf( Int_Xferred ) = 1
    Int_Xferred = Int_Xferred + 1
    IntKiBuf( Int_Xferred    ) = LBOUND(InData%Output,1)
    IntKiBuf( Int_Xferred + 1) = UBOUND(InData%Output,1)
