    IntKiBuf( Int_Xferred + 1) = UBOUND(InData%InputTimes,1)
    Int_Xferred = Int_Xferred + 2

      DO i1 = LBOUND(InData%InputTimes,1), UBOUND(InData%InputTimes,1)
